import React, { useEffect, useState } from 'react';
import { useAuth } from '../contexts/AuthContext';
import { useSocket } from '../contexts/SocketContext';
import ChatWindow from '../components/game/ChatWindow';

interface GameStartData {
  sessionId: string;
  opponent: {
    id: string;
    isAI: boolean;
  };
}

interface GameResult {
  correct: boolean;
  guess: 'human' | 'ai';
  actualType: 'human' | 'ai';
  score: {
    total: number;
    breakdown: {
      basePoints: number;
      messageBonus: number;
      timeBonus: number;
      deceptionBonus: number;
    };
    multiplier: number;
  };
  stats: {
    messageCount: number;
    duration: number;
    averageResponseTime: number;
  };
}

const Game: React.FC = () => {
  const { user } = useAuth();
  const socket = useSocket();
  const [inQueue, setInQueue] = useState(false);
  const [inGame, setInGame] = useState(false);
  const [gameResult, setGameResult] = useState<GameResult | null>(null);

  useEffect(() => {
    if (socket) {
      socket.on('queue-joined', () => {
        setInQueue(true);
        setGameResult(null);
      });

      socket.on('game-started', (data: GameStartData) => {
        setInQueue(false);
        setInGame(true);
        console.log('Game started:', data);
      });

      socket.on('game-result', (result: GameResult) => {
        setGameResult(result);
      });

      socket.on('game-ended', () => {
        setInGame(false);
      });

      return () => {
        socket.off('queue-joined');
        socket.off('game-started');
        socket.off('game-result');
        socket.off('game-ended');
      };
    }
  }, [socket]);

  const joinQueue = () => {
    if (socket) {
      socket.emit('join-queue');
    }
  };

  const makeGuess = (guess: 'human' | 'ai') => {
    if (socket) {
      socket.emit('make-guess', guess);
    }
  };

  return (
    <div className="container mx-auto px-4">
      <div className="bg-game-light rounded-lg shadow-lg p-6">
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-3xl font-bold text-game-dark">Welcome, {user?.username}!</h1>
          {inGame && (
            <div className="space-x-4">
              <button
                onClick={() => makeGuess('human')}
                className="bg-green-500 hover:bg-green-600 text-white px-6 py-2 rounded-lg"
              >
                Guess Human
              </button>
              <button
                onClick={() => makeGuess('ai')}
                className="bg-blue-500 hover:bg-blue-600 text-white px-6 py-2 rounded-lg"
              >
                Guess AI
              </button>
            </div>
          )}
        </div>

        {!inQueue && !inGame && !gameResult && (
          <div className="text-center py-12">
            <button
              onClick={joinQueue}
              className="bg-game-primary hover:bg-game-primary-dark text-white font-bold py-3 px-8 rounded-lg text-lg transition-colors duration-200"
            >
              Find Match
            </button>
          </div>
        )}

        {inQueue && (
          <div className="text-center py-12">
            <div className="animate-pulse text-xl text-game-dark">
              Looking for a match...
            </div>
          </div>
        )}

        {inGame && <ChatWindow />}

        {gameResult && (
          <div className="mt-6 p-6 bg-white rounded-lg shadow">
            <h2 className="text-2xl font-bold mb-4">Game Results</h2>
            <div className="space-y-4">
              <div className="text-lg">
                Your guess was{' '}
                <span className={gameResult.correct ? 'text-green-500' : 'text-red-500'}>
                  {gameResult.correct ? 'correct' : 'incorrect'}
                </span>
                !
              </div>
              <div className="grid grid-cols-2 gap-4">
                <div>
                  <h3 className="font-semibold">Score Breakdown:</h3>
                  <ul className="list-disc list-inside">
                    <li>Base Points: {gameResult.score.breakdown.basePoints}</li>
                    <li>Message Bonus: {gameResult.score.breakdown.messageBonus}</li>
                    <li>Time Bonus: {gameResult.score.breakdown.timeBonus}</li>
                    <li>Deception Bonus: {gameResult.score.breakdown.deceptionBonus}</li>
                    <li>Multiplier: {gameResult.score.multiplier}x</li>
                  </ul>
                </div>
                <div>
                  <h3 className="font-semibold">Stats:</h3>
                  <ul className="list-disc list-inside">
                    <li>Messages: {gameResult.stats.messageCount}</li>
                    <li>Duration: {Math.floor(gameResult.stats.duration / 60)}m {gameResult.stats.duration % 60}s</li>
                    <li>Avg Response Time: {gameResult.stats.averageResponseTime.toFixed(1)}s</li>
                  </ul>
                </div>
              </div>
              <div className="mt-6">
                <button
                  onClick={joinQueue}
                  className="bg-game-primary hover:bg-game-primary-dark text-white font-bold py-2 px-6 rounded-lg"
                >
                  Play Again
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Game;
